const initSate = {
    filters: {
        search :'',
        status : 'All',
        priority : []
    },
    todoList:[
        {
            id: '1',
            courseName:'abccd',
            completed: false,
            priority: 'Medium',

        },
        {
            id: '2',
            courseName:'abc',
            completed: true,
            priority: 'Medium',

        },
        {
            id: '3',
            courseName:'abcc',
            completed: false,
            priority: 'Medium',

        }
    ]
}
 const rootReducer = (state= initSate, action) =>{
    console.log(state, action)
    switch(action.type){
        case 'todoList/addTodo':
            return {
                ...state,
                todoList: [
                    ...state.todoList,
                    {id: 5, courseName: 'leaern redux', completed:false, priority:'Medium'}
                ]
            }
            default: 
                return state;
    }
}
export default rootReducer
